import React from 'react';
function ToDoItem(props) {
  let item = props.item;
  return (
    <div className="col-lg-7">
      <input id="other" type="radio" value="other" name="gender" />
      <label for="other">{item.name}</label>
    </div>
  )
}

export default ToDoItem
